--
-- Data import script for stocks (3rd edition) database
--

DROP DATABASE IF EXISTS `stocks`;
CREATE DATABASE IF NOT EXISTS `stocks`;
USE `stocks`;

--
-- Table structure for table `companies`
--

DROP TABLE IF EXISTS `companies`;

CREATE TABLE `companies` (
  `symbol` varchar(5) NOT NULL,
  `name` varchar(38) NOT NULL,
  `sector` varchar(27) NOT NULL,
  `subindustry` varchar(47) NOT NULL,
  `address` varchar(29) NOT NULL,
  `exchange` varchar(23) NOT NULL,
  `website` varchar(38) NOT NULL,
  `description` varchar(2048) DEFAULT NULL,
  `latitude` float DEFAULT NULL,
  `longitude` float DEFAULT NULL,
  `financials` longtext,
  PRIMARY KEY (`symbol`)
);

--
-- Dumping data for table `companies`
--

LOCK TABLES `companies` WRITE;


UNLOCK TABLES;



--
-- Table structure for table `users`
--

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL,
  `firstname` varchar(50) DEFAULT NULL,
  `lastname` varchar(50) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `country` varchar(50) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `password` varchar(100) DEFAULT NULL,
  `salt` varchar(50) DEFAULT NULL,
  `password_sha256` varchar(100) DEFAULT NULL
);


--
-- Dumping data for table `users`
--

LOCK TABLES `users` WRITE;


UNLOCK TABLES;




--
-- Table structure for table `portfolio`
--

DROP TABLE IF EXISTS `portfolio`;

CREATE TABLE `portfolio` (
  `id` int(11) NOT NULL,
  `userId` varchar(2) DEFAULT NULL,
  `symbol` varchar(8) DEFAULT NULL,
  `amount` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
);


--
-- Dumping data for table `portfolio`
--

LOCK TABLES `portfolio` WRITE;


UNLOCK TABLES;



--
-- Table structure for table `history`
--

DROP TABLE IF EXISTS `history`;

CREATE TABLE `history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `symbol` varchar(5) NOT NULL,
  `date` date NOT NULL,
  `volume` int(11) NOT NULL,
  `open` decimal(13,9) NOT NULL,
  `close` decimal(13,9) NOT NULL,
  `high` decimal(13,9) NOT NULL,
  `low` decimal(13,9) NOT NULL,
  PRIMARY KEY (`id`)
);


--
-- Dumping data for table `history`
--

LOCK TABLES `history` WRITE;


UNLOCK TABLES;

